import './App.css';
import MovieLit from './components/MovieLit';
import  Navbar  from './components/Navbar';
import Video from './components/Video';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div> 
      <Navbar />
      <Routes>
      <Route path="/MovieLit" element={<MovieLit />} />
      <Route path="/Video" element={<Video />} />
      </Routes>



    </div>
  );
}

export default App;
